export default function TabButton({ children, onSelect, isSelected }) {
  return (
    <li>
      <Button colorScheme='teal' variant='ghost' className={isSelected ? 'active' : undefined} onClick={onSelect}>
        {children}
      </Button>
      <button className={isSelected ? 'active' : undefined} onClick={onSelect}>
        {children}
      </button>
    </li>
  );
}
